import { Button } from "@mui/base";
import { Box, Grid, Paper, TextField } from "@mui/material";
import React from "react";

const login = () => {
  return (
    <div>
      <Grid container>
        <Grid item md={3} xs={12}>
          <Box>
            Welcome <br /> God to see you
          </Box>
        </Grid>
        <Grid item md={3} xs={12}>
          <Paper>
            <TextField size="small"></TextField>
          </Paper>
        </Grid>
        <Grid item md={3} xs={12}>
          <Paper>
            <TextField size="small"></TextField>
          </Paper>
        </Grid>
        <Grid item md={3} xs={12}>
          <Paper>
            <Button>Login</Button>
          </Paper>
        </Grid>
      </Grid>
    </div>
  );
};

export default login;
